12. Myth busters: Does the coronavirus affect older people, or are younger people also susceptible? People of all ages can be infected by the coronavirus. Older people, and people with pre-existing medical conditions appear to be more vulnerable.
#IndonesiaSerbia
@WHO https://t.co/khz7upHId7

9. Myth busters: Do vaccines against pneumonia protect you against the new coronavirus? No. Vaccines against pneumonia, such as pneumococcal vaccine and Haemophilus influenza type B (Hib) vaccine, do not provide protection against the new coronavirus.
#IndonesiaSerbia
@WHO https://t.co/8OBrJVuUbe

8. Myth busters: Can spraying alcohol/chlorine all over your body kill the coronavirus? No. Spraying alcohol/chlorine will not kill viruses that have already entered your body. 
#IndonesiaSerbia
@WHO https://t.co/iirAmLUHAM

6. Myth busters: Can an ultraviolet disinfection lamp kill the new coronavirus? UV lamps should not be used to sterilize hands or other areas of skin as UV radiation can cause skin irritation.
#IndonesiaSerbia
@WHO https://t.co/OdHHVmruA0

